import { useState } from 'react';
import Searchbar from './components/Searchbar';

function App() {

  return (
    <main className='app'>
      <header className='header__title'>
        <h1>Fotibol</h1>
      </header>
      <Searchbar 
        fetchTeams={fetchTeams}
        fetchTables={fetchTables}
        teams={teams}
        tables={tables}
      />
      <footer className='footer' ></footer>
    </main>
  );
}

